import React, { useEffect, useState } from "react";
import { Helmet } from "react-helmet";
import { Link } from "react-router-dom";

const initialState = {
  score: 0,
  numberOfQuestions: 0,
  numberOfAnsweredQuestions: 0,
  correctAnswers: 0,
  wrongAnswers: 0,
  hintsUsed: 0,
  fiftyFiftyUsed: 0,
};

const QuizSummary = (props) => {
  const [state, setstate] = useState(initialState);

  useEffect(() => {
    const { location } = props;
    setstate({
      ...location,
      score: (location.score / location.numberOfQuestions) * 100,
    });
  }, []);

  let remark;
  const userScore = state.score;
  if (userScore <= 30) {
    remark = "Don't give up, let's try again!";
  } else if (userScore > 30 && userScore <= 50) {
    remark = "Good progress, shall we practise again?";
  } else if (userScore <= 70 && userScore > 50) {
    remark = "You are doing well, keep it up to see more improvement!";
  } else if (userScore >= 71 && userScore <= 84) {
    remark = "Very good job! You have made steady progress";
  } else {
    remark = "You are doing amazing!";
  }

  let stats;
  if (state) {
    stats = (
      <>
        <h1> This set has ended! </h1>
        <div className="container stats">
          <h4>{remark}</h4>
          <h2>Your score: {state.score}%</h2>
          <span className="stat left">Total Number of Questions:</span>
          <span className="right">{state.numberOfQuestions}</span> <br />
          <span className="stat left">Number of Attempted Questions:</span>
          <span className="right">{state.numberOfAnsweredQuestions}</span>{" "}
          <br />
          <span className="stat left">Number of Correct Answers:</span>
          <span className="right">{state.correctAnswers}</span> <br />
          <span className="stat left">Number of Wrong Answers:</span>
          <span className="right">{state.wrongAnswers}</span> <br />
          <span className="stat left">Hints Used:</span>
          <span className="right">{state.hintsUsed}</span> <br />
          <span className="stat left">50-50 Used:</span>
          <span className="right">{state.fiftyFiftyUsed}</span>
        </div>

        <section>
          <ul>
            <li>
              <Link to="/"> Back to Home</Link>
            </li>
            <li>
              <Link to="/">Play Again</Link>
            </li>
          </ul>
        </section>
      </>
    );
  } else {
    stats = (
      <section>
        <h1 className="no-stats"> No Statistics Available</h1>
        <ul>
          <li>
            <Link to="/play">Try a New Set</Link>
          </li>
          <li>
            <Link to="/">Back to Home</Link>
          </li>
        </ul>
      </section>
    );
  }

  return (
    <>
      <Helmet>
        <title>Your Summary</title>
      </Helmet>
      <div className="quiz-summary">{stats}</div>
    </>
  );
};

export default QuizSummary;
